import React, { useState } from 'react'

function Login() {

  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(email);
    console.log(password)
    const user = {
      email:email,
      password:password
    }

    
    // fetch('https://dummyjson.com/auth/login', {
    //   method: 'POST',
